    "Advanced Electrochemical Oxidation Cell for Purification of Water Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:17:00.867204",nt"name": "advanced-electrochemical-oxidation-cell-for-purification-of-water-project",nt"isopen":
    true,nt"url": null,nt"notes": "Vesitech, Inc. has developed a totally new
    class of water treatment technology utilizing novel carbon based electrodes that
    have been shown to electrochemically produce advanced oxidation (AO) species in-situ
    in contaminated water.  Depending upon the electrode formulation and configuration,
    the species produced include ozone, hydrogen peroxide, superoxide, and hydroxyl
    radicals, all of which are effective in destroying a wide range of toxic chemical
    compounds and microbial contaminants in potable water.  This technology has been
    proven effective in the disinfection of NSF Type I and Type II water. The device
    is very compact, effective, and energy efficient (&lt; 3watts). Residual hydrogen
    peroxide can be produced in sufficient quantities to provide a residual effect and
    inhibit the formation of bio-films. These advanced oxidation electrodes represent
    a new platform technology which will enable effective, inexpensive, and energy efficient
    treatment designs for point-of-use potable water treatment systems",nt"license_title":
